import React from 'react';
import { Button, Card, Container } from 'react-bootstrap';
import Navbar from 'react-bootstrap/esm/Navbar';

export default class ProductListingPage extends React.Component {
    render() {
        return (
            <div>
                <Navbar bg="light" expand="lg">
                    <Container><Navbar.Brand href="#home">Ventail</Navbar.Brand>
                    </Container></Navbar>
                <div className="productContainer">
                    <Card style={{ width: '18rem' }}>
                        <Card.Img variant="top" src="https://nitrosnowboards.com/sites/default/files/styles/variant_photos_protrait_no_crop_xl/public/2020-07/21-cannon-203.png.webp?itok=PtJl1ntI" />
                        <Card.Body>
                            <Card.Title>Card Title</Card.Title>
                            <Card.Text>
                                Some quick example text to build on the card title and make up the bulk of
                                the card's content.
                            </Card.Text>
                        </Card.Body>
                    </Card>
                </div>
            </div>
        )
    }
}
